type Experience = {
        title: string;
        dateRange: {
            from: string;
            to: string;
        };
        content: string;
}

export const PreviousExperienceSet = (
    props: Experience[]
) => {
        <table>
            {props.map((experience:Experience) => PreviousExperience({experience}))}
        </table>
}

export const PreviousExperience = (
    props: {
        exp: Experience 
    }
) => {
    return (
        <>
            <tr>
                <td> <h3>{props.exp.title}</h3> </td>
                <td> {props.exp.dateRange.from} - {props.exp.dateRange.to} </td>
            </tr>
            <tr>
                <td colSpan={2}> {props.exp.content} </td>
            </tr>
        </>
    );
};
